import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/Login';
import Signup from './components/Signup'; // Import the main Signup page

function App() {
  return (
    <Router>
      <Routes>
        {/* Route for login page */}
        <Route path="/" element={<Login />} />
        
        {/* Route for main signup page with role selection */}
        <Route path="/signup" element={<Signup />} />
        
        {/* Other routes for specific roles if needed in future */}
      </Routes>
    </Router>
  );
}

export default App;
